Modern Family is an American television comedy series created by Christopher Lloyd and Steven Levitan that debuted on ABC on September 23, 2009. Lloyd and Levitan serve as showrunners and executive producers under their Levitan-Lloyd Productions label. Depicted in mockumentary style, the fictional characters talk directly into the camera during many situations that arise throughout the series.

Lloyd and Levitan conceptualized the series while sharing stories of their own &quot;modern families&quot;. The series premiered to critical acclaim and was watched by 12.6 million viewers.[1][2] Early on, it was named as a big contender for the 62nd Primetime Emmy Awards.[3] Soon after, the series was picked up for a full season on October 8, 2009.[4][5] On January 12, 2010, Modern Family was renewed for a second season by ABC.[6]

The series has received positive reviews from critics and received multiple award nominations. President Barack Obama said it is his favorite show to watch with his family.[7] The series has won the Emmy Award for Outstanding Comedy Series and the Outstanding Supporting Actor in a Comedy Series twice so far, as well as the Outstanding Supporting Actress in a Comedy Series.[8][9] It also won the Golden Globe Award for Best Television Series Ã¢â‚¬â€œ Musical or Comedy.[10] The syndication rights to the show have also been sold to USA Network and 10 Fox affiliates for a fall 2013 premiere.[11][12][13] The success of the show has also led it to being the sixteenth highest revenue earning show for 2010, earning $1.6 million an episode.[14] On January 10, 2011, Modern Family was renewed for a third season,[15] which premiered with a one-hour special on September 21, 2011.
